  "paths": {
    "/v3/places/search": {
      "get": {
        "tags": [
          "Places"
        ],
        "summary": "Place Search",
        "description": "Search for places in the FSQ Places database using a location and querying by name, category name, taste label, or chain name. For example, search for \"coffee\" to get back a list of recommended coffee shops. \n\nYou must pass a location with your request by using one of the following options:\n\n<ul><li>ll & radius (circular boundary)</li><li>near (geocodable locality)</li><li>ne & sw (rectangular boundary)</li></ul>",
        "operationId": "place-search",
        "parameters": [
          {
            "name": "query",
            "in": "query",
            "description": "A string to be matched against all content for this place, including but not limited to venue name, category, taste, and tips.",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "ll",
            "in": "query",
            "description": "The latitude/longitude around which to retrieve place information. This must be specified as latitude,longitude (e.g., ll=41.8781,-87.6298). One of ll, ne and sw, or near must be specified.",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "radius",
            "in": "query",
            "description": "Defines the distance (in meters) within which to bias place results. The maximum allowed radius is 100,000 meters.",
            "required": false,
            "schema": {
              "maximum": 100000,
              "minimum": 0,
              "type": "integer",
              "format": "int32"
            }
          },
          {
            "name": "categories",
            "in": "query",
            "description": "Filters the response and returns FSQ Places matching the specified categories. Supports multiple Category IDs, separated by commas.\n\nFor a complete list of Foursquare Category IDs, refer to the <a href=\"https://docs.foursquare.com/docs/categories\" target=\"blank\">Category Taxonomy</a> page.",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "chains",
            "in": "query",
            "description": "Filters the response and returns FSQ Places matching the specified chains. Supports multiple chain IDs, separated by commas.",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "exclude_chains",
            "in": "query",
            "description": "Filters the response by only returning FSQ Places that are not known to be part of any chain.",
            "required": false,
            "schema": {
              "type": "boolean"
            }
          },
          {
            "name": "fields",
            "in": "query",
            "description": "Indicate which fields to return in the response, separated by commas. If no fields are specified, all <a href=\"https://docs.foursquare.com/reference/response-fields#core-data-fields\" target=\"_blank\">Core Fields</a> are returned by default. \n\nFor a complete list of returnable fields, refer to the <a href=\"https://docs.foursquare.com/reference/response-fields\" target=\"_blank\">Response Fields</a> page.",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "ne",
            "in": "query",
            "description": "The latitude/longitude representing the north/east points of a rectangle. Must be used with sw parameter to specify a rectangular search box. One of ll, ne and sw, or near must be specified.",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "sw",
            "in": "query",
            "description": "The latitude/longitude representing the south/west points of a rectangle. Must be used with ne parameter to specify a rectangular search box. One of ll, ne and sw, or near must be specified.",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "near",
            "in": "query",
            "description": "A string naming a locality in the world (e.g., \"Chicago, IL\"). If the value is not geocodable, returns an error. One of ll, ne and sw, or near must be specified.",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "sort",
            "in": "query",
            "description": "Specifies the order in which results are listed. Possible values are:<ul><li>relevance (default)</li><li>>rating</li><li>distance</li></ul>",
            "required": false,
            "schema": {
              "type": "string",
              "enum": [
                "RELEVANCE",
                "RATING",
                "DISTANCE",
                "POPULARITY"
              ]
            }
          },
          {
            "name": "limit",
            "in": "query",
            "description": "The number of results to return, up to 50. Defaults to 10.",
            "required": false,
            "schema": {
              "maximum": 50,
              "minimum": 1,
              "type": "integer",
              "format": "int32"
            }
          },
